import React, { Component } from "react";
import "./card.css";
import TextWithTitle from "./text-with-title";

class Card extends Component {
  state = {
    textWithTitle: [
      {
        key: 1,
        title: "License No.",
        text: "Lorem ipsum dolor sit amet,"
      },
      {
        key: 2,
        title: "Medical Condition",
        text: "Lorem ipsum dolor sit amet, consectetuer adipiscing elit. Aenean commodo ligula eget dolor. Aenean massa. Cum sociis natoque penatibus et magnis dis parturient montes, nascetur ridiculus mus. Donec quam felis,"
      },
      {
        key: 3,
        title: "Location",
        text: "Lorem ipsum dolor sit amet"
      }
    ]
  };
  render() {
    return (
      <div className="card">
        <div className="top-section">
          <div className="title">Patient Name</div>
          <div className="date">Date</div>
        </div>
        <div className="content-section">
        {this.state.textWithTitle.map(item => {
          return <TextWithTitle key={item.key} content={item} />;
        })}
        </div>

      </div>
    );
  }
}

export default Card;
